import React from "react";
import { BrowserRouter, Route } from "react-router-dom";
import Main from "../pages/Main";

function Routers() {
  return;
  <BrowserRouter>
    <Route component={Main} path="/"></Route>;
  </BrowserRouter>;
}

export default Routers;
